    <div className="container">
      <div className="d-flex justify-content-evenly ">
        <div className="p-2 event2 fade-up-animate-load">
          <h1>Access to hidden talent</h1>
          <p>We find IT specialists that fit your needs. Even for hard-to-fill positions.</p>
        </div>
        <div className="p-2 event2 fade-up-animate-load">
